import React, { Component } from 'react';

class MainLanding extends Component {

    render() {
        return (
            <div>
                <p>Welcome to Main Landing Component!!</p>
                <p>{this.props.loggedIn}</p>
            </div>
        )
    }
}

export default MainLanding;
